import { LinkIcon } from 'lucide-react';
import { useFaceHover } from '../context/FaceHoverContext';

const BentoTilt = ({ children, className = '' }) => {
    const itemRef = useRef();

    const handleMouseMove = (e) => {
        if (!itemRef.current) return;
        const { left, top, width, height } = itemRef.current.getBoundingClientRect();
        const relativeX = (e.clientX - left) / width;
        const relativeY = (e.clientY - top) / height;

        const tiltX = (relativeY - 0.5) * 5;
        const tiltY = (relativeX - 0.5) * -5;

        itemRef.current.style.transform = `perspective(700px) rotateX(${tiltX}deg) rotateY(${tiltY}deg) scale3d(0.98,0.98,0.98)`;
        itemRef.current.style.backgroundColor = '#292929';

    };

    const handleMouseLeave = () => {
        if (itemRef.current) {
            itemRef.current.style.transform = '';
            itemRef.current.style.backgroundColor = 'black';
        }
    };

    return (
        <div
            className={className}
            ref={itemRef}
            onMouseMove={handleMouseMove}
            onMouseLeave={handleMouseLeave}
        >
            {children}
        </div>
    );
};

